# remove prefixs
def prune_prefix(s):
    for pfx in prefixes_to_ignore:
        if s.startswith(pfx):
            s=s[len(pfx):]
            return prune_prefix(s)
    return s

# remove suffix
def prune_suffix(s):
    for sfx in suffixes_to_ignore:
        if s.endswith(sfx):
            s=s[:-len(sfx)]
            return prune_suffix(s)
    return s

def remove_lbracket_number_rbracket(s):
    matches = re.findall("\[[0-9]+\]", s)
    matches = list( dict.fromkeys(matches) )
    matches.sort()
    for m in matches:
        s=s.replace(m, '')
    return s



